  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130369 contains raw underway
  meteorological, navigational, physical and time series data logged by the Scientific
  Computer System (SCS) aboard NOAA Ship Ronald H. Brown in the Coastal Waters of
